{
  "model": "termsandconditions.termsandconditions",
  "pk": 10,
  "fields": {
    "slug": "optional-terms",
    "name": "Optional Terms & Conditions",
    "version_number": "1.00",
    "text": "<h1>Optional Terms &amp; Conditions</h1>\n\n<p>These Terms &amp; Conditions supplement the basic Terms &amp; Conditions for our Services. You are free to use our Services without agreeing to this Supplement.</p>\n\n<p>This Supplement will allow us to carry out a research project impossible without a large centralized repository of topography data. We kindly ask you to consider agreeing to this Supplement and thereby support our research efforts in reciprocity for using the Services.</p>\n\n<h2>Additional permissions for statistical analysis of your data</h2>\n\n<p>By using our Services, you may provide us with information and files (your data). By agreeing to these optional conditions you give permission to us to inspect your data and run statistical analyses on your data. By \"us\" we are referring to the principal investigators</p>\n\n<ul>\n<li>Prof. Tevis Jacobs, University of Pittsburgh</li>\n<li>Prof. Lars Pastewka, University of Freiburg, the operator of this site</li>\n<li>Prof. Mark O. Robbins, Johns Hopkins University</li>\n</ul>\n\n<p>and by extension members of the respective research groups. By statistical analysis we mean, for example, computing global bounds on scalar roughness parameters such as the root-mean-square slope and height or classification using machine learning techniques such as the support vector machine. These analyses are part of a <a href=\"https://cordis.europa.eu/project/rcn/212185/factsheet/en\">research project</a> funded by the European Research Council on how surface roughness emerges. We want identify recurring patterns that would allow to identify, for example, the processing history of a piece of material from its surface, as practiced for example in fractography.</p>\n\n<p>We may decide to publish part of this statistical information in form of a journal publication or present it at conferences. No form of dissemination will happen without us asking for your consent. We will offer you co-authorship in accordance with the rules for <a href=\"http://www.allea.org/wp-content/uploads/2017/03/ALLEA-European-Code-of-Conduct-for-Research-Integrity-2017-1.pdf\">European Code of Conduct for Research Integrity</a> and the rules for <a href=\"http://doi.org/10.1002/9783527679188.oth1\">Good Scientific Practice of the Deutsche Forschungsgemeinschaft</a>. Let us make it clear that we will under no circumstances publish your data and results derived from it without obtaining written permission from you to do so.</p>\n\n<h2>Contacting you</h2>\n\n<p>By agreeing to this Supplement, you also give permission to contact you via the e-mail address registered on our site. We may contact you to discuss publication of derived data or to ask you to provide additional metadata on topographies uploaded by you. More broadly, you give us permission to contact you to start a scientific discussion on patterns we may find in your data.</p>\n",
    "info": null,
    "date_active": "2019-03-25T14:30:28.650Z",
    "date_created": "2019-03-25T14:30:28.654Z",
    "optional": true
  }
},
